import styles from "./TodoItem.module.css";

export default function TodoItem({ item }) {
  return (
    <div className={styles.todolistitem}>
      <div className={styles.todoitem}>{item}</div>
      <span>
        <button>x</button>
      </span>
      <hr className={styles.line} />
    </div>
  );
}
